import Input from '../UI/Input/Input';
import styles from './PlayQuiz.module.css'

let PlayQuiz = (props) =>{
    return(
        <div className={styles["game-panel"]}>
            <div id='question' className={styles.question}>
            <Input data={{type:'text',value:1,className:styles.op,id:'op1'}}></Input>
            <div id='operand' className={styles.opr}>+</div>
            <Input data={{type:'text',value:2,className:styles.op,id:'op2'}}></Input>
            <div className={styles.opr}>=</div>
            <Input data={{type:'text',value:3,className:styles.op,id:'op3'}}></Input>
        </div>
        </div>
    )    
}

export default PlayQuiz;
